import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import MainPage from './Components/Main-page/Mainpage';
import LoginPage from './Components/Login-page/LoginPage';
import Sign from './Components/Sign-page/Sign'; // Signup page
import Dashboard from './Components/Dashboard/Dashboard';
import Workspace from './Components/Workspace/Workspace';
import Response from './Components/Response/Response'; // Import additional components if required

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Main Page */}
          <Route
            path="/"
            element={<MainPage />}
          />

          {/* Login Page */}
          <Route
            path="/login"
            element={<LoginPage />}
          />

          {/* Signup Page */}
          <Route
            path="/signup"
            element={<Sign />}
          />

          {/* Dashboard */}
          <Route
            path="/dashboard"
            element={<Dashboard />}
          />

          {/* Workspace */}
          <Route
            path="/workspace"
            element={<Workspace />}
          />

          {/* Response Component */}
          <Route
            path="/response"
            element={<Response />}
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
